import React from 'react';

const Playground = () => {
  const posts = [
    {
      name: 'a',
      length: 100,
      title: 'important',
    },
    {
      name: 'b',
      length: 200,
      title: 'not important',
    },
  ];

  function getPosts() {
    setTimeout(() => {
      posts.map((post) => {
        console.log(post.title);
      });
    }, 1500);
  }

  function createPost(cb) {
    setTimeout(() => {
      posts.push({ name: 'c', length: 300, title: 'mid importance' });
      cb();
    }, 500);
  }

  return (
    <div>
      <div style={{ margin: 20 }}>
        <h1>Playground</h1>
        {/* {getPosts()} */}
        {createPost(getPosts)}
      </div>
    </div>
  );
};

export default Playground;
